import React from "react";
import Button from "./button";

import { useNavigate } from "react-router-dom";
function TableComp(props) {
  let logedinUser = JSON.parse(localStorage.getItem("logedinUser"));
  const handleEditUser=(user)=>{
  localStorage.setItem("editUserData",JSON.stringify(user));
  let navigate = useNavigate();

  function handleClick() {
    navigate(props.path);
  }
  }
  return (
    <table>
      <thead>
        <tr>
          <th>S.no</th>
          <th>Name</th>
          <th>Email</th>
          <th>Role</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {props.userArr.map((user, index) => (
          <tr key={user.name}>
            <td>{index + 1}</td>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>{user.role}</td>
            <td>
              {logedinUser.role === "Admin" ||
              logedinUser.role === "Manager" ? (
                <Button label="Edit" onClick={()=>handleEditUser(user)} path="/dashboard/update"/>
              ) : (
                ""
              )}
              {logedinUser.role === "Admin" ? <Button label="Delete" /> : ""}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default TableComp;
